// Header.js
import React from "react";
import "./Menu.css"; // Importar estilos

function Header() {
    return (
        <header>
            <div className="menu">
                <ul>
                    <li>
                        <a href="#">Home</a>
                    </li>
                </ul>
            </div>
            <h1>Movie Reviews</h1>
        </header>
    );
}

export default Header;
